import axios from 'axios'

class UserService{

    signup_service(data){
        return axios.post(base+"signupjwt/",data)
    }


    login_service(data){
        return axios.post(base+"user_login/", data)
    }

    forgotPassword_service(data){
        return axios.post(base+"forgot_password/",data)
    }



}
export default UserService;
